import SEO from './seo/SEO';

function Home() {
  return (
    <div>
      <SEO title="Home | SEO React App" description="Welcome to the SEO optimized React app!" />
      <h1>საძიებო სისტემის ოპტიმიზაცია</h1>
      <p>This content is visible to search engines after JS is rendered.</p>
    </div>
  );
}

export default Home;
